import { useDispatch } from "react-redux";
import "./Dialog.css";

const Dialog = () => {
    const visible = useSelector((state) => state.dialog.dialogVisible);

    const dispatch = useDispatch();
    return <div className="dialog-container"></div>;
};
export default Dialog;
